import React from 'react'


const Chef:React.FC<{key:string, chefName:string, chefName:string, restaurantImage:string}> = (props) => {
  return (
    <div className="popular-item">
        <h2>{props.restaurantName}</h2>
        <p>{props.chefName}</p>
    </div>
  )
}
export default Chef;
